INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (100, 0.0, 10.85, 129901, 0.0, "訓練成功、おめでとうございます\n褒めるべき時にはしっかり褒めるのも\n教官の務めですものね。それとも、\n罵られる方が好みですか？　クスクス", "エリコ", 24, 100, "2030/12/17 14:59:59", 10142, 7, 1, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (101, 0.0, 11.15, 129901, 0.0, "厳しい訓練も、終わってみれば\n短く感じるものですわね。\n正直、私は暴れ足りないくらい…\nいえ、何でもありませんわ。クスクス", "エリコ", 24, 101, "2030/12/17 14:59:59", 10142, 2, 1, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (102, 0.0, 6.4, 129901, 0.0, "行く手を阻む忌々しい邪魔者を\n蹴散らして、見事ゴールイン…！\nまるで私とあのおかたの人生を\n象徴するような道のりでした…", "エリコ", 24, 102, "2030/12/17 14:59:59", 10142, 5, 7, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (103, 0.0, 0.0, 129901, 0.0, "まったくもって不甲斐ない結果です\nしかし、挽回の機会はまだありますわ\n次はゴミ虫の地位から脱却できるよう\n死力を尽くしなさい。いいですね？", "エリコ", 24, 103, "2030/12/17 14:59:59", 10142, 3, 3, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (104, 0.0, 2.43, 129901, 0.0, "クスクス…ああご心配なさらず\nなんとも情けない成績を残す輩には\nどんな罰が相応しいか、考えている\nだけですので…クスクスクス", "エリコ", 24, 104, "2030/12/17 14:59:59", 10142, 8, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (105, 0.0, 9.08, 129901, 0.0, "私が教官として認められなければ、\nあのおかたを失望させてしまう…\nそれだけはあってはなりません\nあなた方も、わかっていますわね？", "エリコ", 24, 105, "2030/12/17 14:59:59", 10142, 3, 4, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (106, 0.0, 0.0, 129901, 0.0, "まずまずの結果ではありますが、\nこの程度で満足してもらっては\n困りますわ。エリコ班の一員として、\nより高みを目指していただきますので", "エリコ", 24, 106, "2030/12/17 14:59:59", 10142, 6, 6, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (107, 0.0, 10.6, 129901, 0.0, "私の指導を受けながら、この結果は…\nもっと真剣に考えねばなりませんね\nあなた方が怠けずにいるには、\nどんなしつけが必要かを…クスクス", "エリコ", 24, 107, "2030/12/17 14:59:59", 10142, 8, 3, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (108, 0.0, 7.54, 129901, 0.0, "ひとまず訓練をこなしたご褒美か、\n実力を出しきれたとは言えない罰か…\nみなさんにどちらを与えるべきか\n少し悩む結果ですわね", "エリコ", 24, 108, "2030/12/17 14:59:59", 10142, 4, 6, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (109, 0.0, 11.5, 129901, 0.0, "なかなかいい戦いぶりでしたわ\nこれもあなた方の頑張りと、何より\n優秀な教官である私の教育の賜物\nそうですわね？　クスクスクス…", "エリコ", 24, 109, "2030/12/17 14:59:59", 10142, 7, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (110, 0.0, 8.83, 129901, 0.0, "これだけ進めたのならば合格点ですわ\nでも、もっと高みを目指したいと\n思っているのなら…さらなる訓練にも\n付き合って差し上げましょう", "エリコ", 24, 110, "2030/12/17 14:59:59", 10142, 1, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (111, 0.0, 6.68, 129901, 0.0, "未熟で頼りなかったあなた方が、\n見違えるように成長しました\nなるほど…これこそが、教官冥利に\n尽きるという気持ちなのですね", "エリコ", 24, 111, "2030/12/17 14:59:59", 10142, 2, 1, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (112, 0.0, 8.8, 129901, 0.0, "まさかあなた方が、私の予想すら\n超える力を発揮するとは…驚きました\nもはやゴミ虫などではありません\n一人前の騎士として胸を張りなさい", "エリコ", 24, 112, "2030/12/17 14:59:59", 10142, 2, 6, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (113, 0.0, 8.9, 129901, 0.0, "クスクス、見事な働きです\nみなさんならできると信じていました\n他でもない私の指導を受けた、\nエリコ班の優秀な新兵なのですから", "エリコ", 24, 113, "2030/12/17 14:59:59", 10142, 1, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (114, 0.0, 3.7, 129901, 0.0, "なんてすばらしい成績…！\n今日という日は『あのおかたを想い\nエリコが限界を超えた記念日』として\n歴史に刻まれることでしょう…！", "エリコ", 24, 114, "2030/12/17 14:59:59", 10142, 5, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (200, 0.0, 7.6, 129801, 0.0, "よし、いい訓練になったな\nおまえたちもよく動けてたし、\nちゃんと成長できてると思うぜ\nその調子で頑張れよっ", "マコト", 24, 200, "2030/12/17 14:59:59", 10142, 2, 1, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (201, 0.0, 2.25, 129801, 0.0, "ひとまずゴールおめでとう！\nでも、努力は継続してこそだからな\nおまえたちにやる気があるなら、\n何度だって付き合ってやるよ", "マコト", 24, 201, "2030/12/17 14:59:59", 10142, 1, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (202, 0.0, 3.28, 129801, 0.0, "行軍訓練はこれにて完了！\n…なーんて思ってないよな？\n学んだことが体に染みつくまで\n地道に繰り返すのが練習ってもんさ", "マコト", 24, 202, "2030/12/17 14:59:59", 10142, 1, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (203, 0.0, 2.98, 129801, 0.0, "みんなに無理をさせちまったか…\nでもこれで諦めることはないぜ\n次はきっとうまくいく。そう信じて\n鍛え続ければ、道は開けるはずだ！", "マコト", 24, 203, "2030/12/17 14:59:59", 10142, 1, 4, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (204, 0.0, 3.0, 129801, 0.0, "こいつは悔しい結果だな…\nま、反省点はいろいろあったし\nひとつずつ乗り越えていこう\nあたしたちで力を合わせて、なっ！", "マコト", 24, 204, "2030/12/17 14:59:59", 10142, 1, 4, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (205, 0.0, 10.3, 129801, 0.0, "おまえたちはまだ未熟な訓練兵、\n失敗を必要以上に悔やむことはねえよ\nでも実戦じゃこうはいかないからな\n次は気合を入れ直していけよっ！", "マコト", 24, 205, "2030/12/17 14:59:59", 10142, 2, 1, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (206, 0.0, 2.93, 129801, 0.0, "これがおまえたちの全力？\nいやいや、そんなはずはないよなっ\nおまえらならもっと強くなれる！\nあたしが言うんだ、間違いないぜ！", "マコト", 24, 206, "2030/12/17 14:59:59", 10142, 1, 6, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (207, 0.0, 9.3, 129801, 0.0, "おまえたちの実力を考えりゃ、\nベストを尽くせたとは言えない成績だ\nなら、次やるべきことも決まってる\n気持ちを切り替えて、鍛え直すんだ！", "マコト", 24, 207, "2030/12/17 14:59:59", 10142, 1, 3, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (208, 0.0, 6.9, 129801, 0.0, "まだまだ課題がある内容だったな～\n無駄な動き、判断の遅れ…\nそういうのをしっかり直していけば、\n記録ももっと伸びるはずだっ", "マコト", 24, 208, "2030/12/17 14:59:59", 10142, 1, 4, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (209, 0.0, 0.0, 129801, 0.0, "ここまでいけりゃ、合格点！\nむしろ、最初の頼りなさを思えば\nすげえ成長してるんじゃねえか？\n胸を張れる結果だと思うぜっ！", "マコト", 24, 209, "2030/12/17 14:59:59", 10142, 2, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (210, 0.0, 5.95, 129801, 0.0, "なかなかハードな訓練だったけど、\nみんなしっかりついてこられたな\n地道に続けた基礎トレの成果が\n形になってる、その証だぜっ", "マコト", 24, 210, "2030/12/17 14:59:59", 10142, 2, 1, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (211, 0.0, 6.73, 129801, 0.0, "今回の訓練もよく頑張ったな！\nしっかり休んで次に備えろよ！\nなんつーか、教え子が成長してくのを\n見るのは楽しいもんだな…", "マコト", 24, 211, "2030/12/17 14:59:59", 10142, 1, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (212, 0.0, 0.0, 129801, 0.0, "おまえら、すげえじゃねえか！\nこれならもう、ひよっこ新兵なんて\n言えねえな。きっと騎士団でも\n大活躍間違いなしだぜ！", "マコト", 24, 212, "2030/12/17 14:59:59", 10142, 2, 2, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (213, 0.0, 6.65, 129801, 0.0, "敵との戦い方、状況判断の正確さ\n何より根性…どれも最高だったぞ！\nうかうかしてたら、教官のあたしまで\n追い抜かれちまうかもな…へへっ", "マコト", 24, 213, "2030/12/17 14:59:59", 10142, 2, 1, "2024/03/31 12:00:00");
INSERT INTO `v1_be20a9b90695975294ec14c19d87b756cedf937d2e569073346434e8abc33a14` VALUES (214, 0.0, 3.05, 129801, 0.0, "あたしの指導が良かった？\nいやいや、ここまで強くなれたのは、\n他でもないおまえたち自身が努力した\nおかげだよ。改めて…おめでとうっ！", "マコト", 24, 214, "2030/12/17 14:59:59", 10142, 1, 6, "2024/03/31 12:00:00");
